      var type = "file";
      if (item.mode === "post") {
        type = "file_post";
      } else if (item.mode === "space") {
        type = "file_space";
      } else if (item.mode === "snippet") {
        type = "file_snippet";
      } else if (item.mode === "arugula") {
        type = "file_arugula";
      }
      var sharing_html = TS.templates.builders.buildFileSharingControls(item, true, null, has_title);
